void add_date_to_list(int pos)
{
	datepos *d = (datepos*)malloc(sizeof(datepos));
	d->pos=pos;
	d->next=NULL;
	
	if(droot==NULL)
	{
		droot=d;
		drear=d;
	}	
	else
	{
		drear->next=d;
		drear=d;
	}

}

void add_to_list(char org[],char der[])
{
	int flag=0,i;
	node *n=(node*)malloc(sizeof(node));
	strcpy(n->orig_text,org);
	strcpy(n->derived,der);
	n->pos = count;
	n->next = NULL;	
	n->dist=999;

	for(i=0;i<strlen(org);i++)
	{
		if(org[i]>='0' && org[i]<='9')
		{
			flag=1;
		}
	}

	if(flag==0)
	{
		return;
	}

	
	if(root==NULL)
	{
		root=n;
		rear=n;
	}
	else
	{
		rear->next = n;
		rear=n;
	}
}


