node* make_decision()
{
	int m;
	node *p=root;
	datepos *d=droot;
	node *ans;
	
	//print_list();
	//print_dlist();
	
	if(droot==NULL)
	{
		return root;
	}
	


	while(p!=NULL)	
	{
		p->dist = p->pos - d->pos;		
		p=p->next;
	}
	d=d->next;
	
	while(d!=NULL)
	{
		p=root;
		while(p!=NULL)
		{
			if(p->pos-d->pos > 0)
			{
				p->dist = min(p->dist,p->pos-d->pos);
			}			
			p=p->next;
		}
		d=d->next;	
	}

	p=root;
	m=999;
	while(p!=NULL)
	{
		if(p->dist>0)
		{
			if(p->dist < m)
			{
				m=p->dist;
				ans = p;
			}
		}
		p=p->next;
	}	


	return ans;
}

int min(int a,int b)
{
	if(a<b)
		return a;
	else
		return b;
}
